import axios from 'axios';
import React, { useEffect, useState } from 'react'
import { Link } from 'react-router-dom'

function Home() {
  const [cars,setCars] = useState([]);

  useEffect( () => {
      axios.get('http://127.0.0.1:8000/api/cars').then((response) => {
        setCars(response.data);
        console.log(response.data);
      })
    }, []);
  return (
    <div className='main'>
      <table className='table table-striped'>
        <thead>
          <tr>
            <th>ID</th>
            <th>Marka</th>
            <th>Model</th>
            <th>Şanzıman Türü</th>
            <th>İlan Tarihi</th>
            <th>İşlemler</th>
          </tr>
        </thead>

        <tbody>
        {cars.map((car) => (
    <tr key={car.id}>
      <td>{car.id}</td>
      <td>{car.marka}</td>
      <td>{car.model}</td>
      <td>{car.sanzimanTuru}</td>
      <td>{car.ilanTarihi}</td>
      <td>
      <Link to={`/edit-car/${car.id}`} className='btn btn-sm btn-success mx-1'>Düzenle</Link>
      <button className='btn btn-sm btn-danger'>Sil</button>
      </td>
    </tr>
))}

          
        </tbody>
      </table>
    </div>
  )
}

export default Home
